import React from 'react';
import './Buttons.css'










const Buttons = (props) => {
  return (

<div>
<button className = "first" onClick={()=> window.open('https://aws.amazon.com/')}>AWS</button>
<button className = "second">Azure</button>
<button className = "third">Google</button>

</div>
)
}


export default Buttons;
